                        "title": "Promptbook: Orchestrate LLMs Easily",
                        "content": "Promptbook aims to simplify the development of complex LLM-powered applications by abstracting away low-level model details. It's designed for use cases involving generating complex outputs like websites, articles, code, etc., and orchestrating multiple prompts.  It's not ideal for simple prompts, streaming applications, or tasks outside text generation (currently).  Known limitations include missing iterations and import functionality.",
